import React, { useState } from 'react'
import HeaderHamburger from './HeaderHamburger'
import { ButtonDiv, SignInButton, SignInDiv, SignInInput, SignInP } from './StyleHeader'

export default function SignUp() {
    const [message, setMessage] = useState('');

  const handleChange = (event:any) => {
    setMessage(event.target.value);
  };
//   const AddUser = () => {
//       setSignInOpen(!SignInOpen);
//     }
  return (
      <SignInDiv>
        <HeaderHamburger/>
        <SignInP> SIGN UP </SignInP>
        <SignInInput onChange={handleChange}
        value={message} placeholder='Email address'/><br/>
        <SignInInput placeholder='Password'/><br/>
        <SignInInput placeholder='Confirm Password'/><br/>
        <ButtonDiv>
        <SignInButton> SIGN UP </SignInButton>
        </ButtonDiv>
    </SignInDiv>
  )
}
